import Layout from "../components/Layout";
import Head from "next/head";
import styled from "styled-components";

const TitleHello = styled.h1`
  color: red;
`;

const Index = () => {
  return (
    <Layout>
      <Head>
        <title>Index 페이지</title>
      </Head>
      <TitleHello>안녕! next.js</TitleHello>
    </Layout>
  );
};

export default Index;
